import '../App.css';
import Discord from '../img/DiscordLogo.JPG';
import Seam from '../img/seams.jpg';

document.querySelector(".discordBot").addEventListener("click", () => {
    window.open(
      "https://github.com/JJosan/Discord-Bot", "_blank");
  })
  
  
  document.querySelector(".seamCarver").addEventListener("click", () => {
    window.open(
      "https://github.com/JJosan/Image-Resizer", "_blank");
  })

function Projects() {
  return (
    <section className="four">
        <div className="text">
            <h2>Projects</h2>
            <p>Here are some personal projects that I have worked on / am working on.
            </p>
            <div className="projects">
                <div className="discordBot" href="https://github.com/JJosan/Discord-Bot" style={{ backgroundImage:`url(${Discord})`}}>
                    <h3>Discord Bot</h3>
                </div>
                <div className="seamCarver" style={{ backgroundImage:`url(${Seam})`}}>
                    <h3>Image Resizer</h3>
                </div>
            </div>

        </div>
    </section>
  );
}

export default Projects;
